import React from 'react';

function Blog() {
  return (
    <div>
      <h2>Blog</h2>
      <p>Welcome to my blog! Here, I share my thoughts and experiences on software development, information security, and the tech industry.</p>
      <ul>
        <li>
          <strong>Building Secure Microservices on AWS</strong>
          <p>An overview of best practices for developing microservice-based architectures with a focus on security using AWS infrastructure.</p>
        </li>
        <li>
          <strong>Deep Dive into Browser Security</strong>
          <p>Exploring common browser vulnerabilities and mitigation strategies, based on projects from my Browser Security course.</p>
        </li>
      </ul>
    </div>
  );
}

export default Blog;
